import React, { Component } from 'react';
//import { getUsers } from '../../redux/action-creators';
import { BrowserRouter, Router, Switch } from 'react-router-dom';
import Home from '../../components/UserList';
import UserList from '../../components/UserList';
// import CreateUser from '../../components/CreateUser';
// import EditUser from '../../components/EditUser';

class App extends Component {
  componentDidMount() {
    this.props.getUsers();
  }
  render() {
    return (
      <BrowserRouter>
          <Switch>
            <Router exact = {true} path = '/' 
              render = {(props) => <UserList {...props}
                createUser = {this.createUser}
                deleteUser = {this.deleteUser}
                getUsers = {this.getUsers}
                editUser = {this.editUser}
              /> } 
            />
            <Router path = '/' render = {(props) => <Home {...props}/>} />
            {/* <Router path = '/users' component = {CreateUser} /> */}
            {/* <Router path = '/users/:user_id' component = {EditUser} /> */}
          </Switch>
      </BrowserRouter>
    );
  }
}

const mapStateToProps = (state) => {
  return {
    users: state.getUsers.users
  }
};

const mapDispatchToProps = (dispatch) => {
  return {
    getUsers: () => {
      dispatch(getUsers());
    },
  }
};
export default App;
